const express = require('express');
const router = express.Router();
const { submitGrievance, getGrievances } = require('../controllers/grievanceController'); // Make sure these are correctly imported

// Route to submit a grievance
router.post('/submit', submitGrievance); // Make sure submitGrievance is defined

// Route to get all grievances
router.get('/', getGrievances); // Make sure getGrievances is defined

module.exports = router;
